import React from 'react';
import './App.css';

import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Typography from '@material-ui/core/Typography';
import Paper from '@material-ui/core/Paper';
import Container from '@material-ui/core/Container';

import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';

class App extends React.Component {

	state = {
		restaurantList: []
	};

	componentDidMount() {
		this.getRestaurantData();
	}

	getRestaurantData = async () => {
		const response = await fetch("http://localhost:8080/api/restaurants");
		const { data } = await response.json();
		this.setState({ restaurantList : data })
	}

	render() {
		return (
			<div className="App">
				<AppBar position="static">
					<Toolbar>
						<IconButton edge="start" color="inherit" aria-label="menu">
							<MenuIcon />
						</IconButton>
						<Typography variant="h6">Restaurants</Typography>
						<Button color="inherit">Login</Button>
					</Toolbar>
				</AppBar>
				<Container>
					<Paper>
						<Typography component="h2" variant="h6" color="primary" gutterBottom>Titre</Typography>
						<Table aria-label="simple table">
							<TableHead>
								<TableRow>
									<TableCell>Name</TableCell>
									<TableCell>Cuisine</TableCell>
									<TableCell>Borough</TableCell>
								</TableRow>
							</TableHead>
							<TableBody>
								{this.state.restaurantList.map((restaurant, key) => (
									<TableRow key={key}>
									<TableCell>{restaurant.name}</TableCell>
									<TableCell>{restaurant.cuisine}</TableCell>
									<TableCell>{restaurant.borough}</TableCell>
									</TableRow>
								))}
							</TableBody>
						</Table>
					</Paper>
				</Container>
			</div>
		);
	}

}

export default App;
